// src/components/TimelineGraph.js
import React from 'react';
import { Bar } from 'react-chartjs-2';

const TimelineGraph = ({ data }) => {
  const timestamps = data.map(entry => entry.ts);
  const samples = data.map(entry => entry.vibration);

  const chartData = {
    labels: timestamps,
    datasets: [{
      label: 'Vibration',
      backgroundColor: samples.map(sample => sample === 0 ? 'yellow' : sample === 1 ? 'green' : 'red'),
      data: samples
    }]
  };

  return (
    <div>
      <h2>Timeline Graph</h2>
      <Bar
        data={chartData}
        options={{
          maintainAspectRatio: false,
          scales: {
            xAxes: [{
              type: 'time',
              time: {
                unit: 'hour',
                displayFormats: {
                  hour: 'HH:mm:ss'
                }
              }
            }]
          }
        }}
      />
    </div>
  );
};

export default TimelineGraph;
